import './App.css';

function Alert({ header, body }) {
  return (
    <div className="alert">
      {header && <h5>{header}</h5>}
      {body}
    </div>
  );
}

function App() {
  return (
    <div className="App">
      <div className="setup">
        <p>Alert Setup</p>
        {/* <input type="checkbox"></input> */}
        <div className="setup--header">
          <p>Header</p>
        </div>
        <div className="setup--body">
          <label>
            Body Text:
            <textarea name="alertBodyText" defaultValue="Enter body text" rows={4} cols={40} />
          </label>
        </div>
      </div>
      <div className="examples">
        <div className="example">
          <p>Current</p>
          <Alert
            header="Current Example"
            body="hey"
          />
        </div>
        <div className="example">
          <p>New</p>
          <Alert
            header="New Example"
            body="heyy"
          />
        </div>
      </div>
    </div>
  );
}

export default App;
